import { useState,useEffect } from "react";
import   '../styles/PuzzlePage.css';

export  const PuzzleComponent=()=>{

    const puzzlePeace=[
        { id: 1, top: 0, left: 0, backgroundPosition: '0 0' },
        { id: 2, top: 0, left: 100, backgroundPosition: '-100px 0' },
        { id: 3, top: 0, left: 200, backgroundPosition: '-200px 0' },
        { id: 4, top: 0, left: 0, backgroundPosition: '0 0' },
        { id: 5, top: 0, left: 100, backgroundPosition: '-100px 0' },
        { id: 6, top: 0, left: 200, backgroundPosition: '-200px 0' },
    ]

    return(
        <>
            <div className="jigsaw-puzzle-main">
                {
                    puzzlePeace.map((peaces)=>{
                        <div 
                        key={peaces.id}
                        className="puzzle-peaces"
                        style={{
                            top: `${peaces.top}px`,
                            left: `${peaces.left}px`,
                            backgroundPosition: peaces.backgroundPosition,
                          }}
                        >

                        </div>
                    })
                }



            </div>
        </>
    );

}
